    WITH a, b
    MATCH (a)-[:EXHIBITED_WITH]->(otherArtist)-[:CREATED]->(otherEntry)
    WHERE otherArtist.country <> '\N' AND otherEntry.technique <> '\N'
    WITH a, otherArtist
    LIMIT 2
    RETURN (a)-[:EXHIBITED_WITH]->(otherArtist)
     `);  */


