        this.deathplace = properties.deathplace;
        this.pnd = String(properties.pnd);
        this.ulan = String(properties.ulan);
    }
}

const findAll = async () => {
    const result = await session.run('MATCH (a:Artist) RETURN a LIMIT 10');
